  return (
    <>
      <div className="colaborators-container">
        <h2>Colaboradores</h2>
        <div className="colabs-cards">
          <img src={logo} alt="Colaborator 1" className='colab'/>
          <img src={logo} alt="Colaborator 1" className='colab'/>
